@testset "4.3.1.2 (d sec)^m (a+b tan)^n" begin
    (a, b, c, d, e, f, m, n, x, ) = @variables a b c d e f m n x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(d*sec(e+f*x))^m*(a+b*tan(e+f*x))^n=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d*sec(e+f*x))^m*(a+b*tan(e+f*x))^n*when*a^2+b^2=0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(d*sec(e+f*x))^m*(a+a*im*tan(e+f*x))^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [sec(c + d*x)^10*(a + im*a*tan(c + d*x)), x, 3, (im*a*sec(c + d*x)^10)/(10*d) + (a*tan(c + d*x))/d + (4*a*tan(c + d*x)^3)/(3*d) + (6*a*tan(c + d*x)^5)/(5*d) + (4*a*tan(c + d*x)^7)/(7*d) + (a*tan(c + d*x)^9)/(9*d)]
    @test_int [sec(c + d*x)^8*(a + im*a*tan(c + d*x)), x, 3, (im*a*sec(c + d*x)^8)/(8*d) + (a*tan(c + d*x))/d + (a*tan(c + d*x)^3)/d + (3*a*tan(c + d*x)^5)/(5*d) + (a*tan(c + d*x)^7)/(7*d)]
    @test_int [sec(c + d*x)^6*(a + im*a*tan(c + d*x)), x, 3, (im*a*sec(c + d*x)^6)/(6*d) + (a*tan(c + d*x))/d + (2*a*tan(c + d*x)^3)/(3*d) + (a*tan(c + d*x)^5)/(5*d)]
    @test_int [sec(c + d*x)^4*(a + im*a*tan(c + d*x)), x, 3, (im*a*sec(c + d*x)^4)/(4*d) + (a*tan(c + d*x))/d + (a*tan(c + d*x)^3)/(3*d)]
    @test_int [sec(c + d*x)^2*(a + im*a*tan(c + d*x)), x, 3, -((im*(a + im*a*tan(c + d*x))^2)/(2*a*d)), (im*a*sec(c + d*x)^2)/(2*d) + (a*tan(c + d*x))/d]
    @test_int [sec(c + d*x)^0*(a + im*a*tan(c + d*x)), x, 2, a*x - (im*a*log(cos(c + d*x)))/d]
    @test_int [cos(c + d*x)^2*(a + im*a*tan(c + d*x)), x, 3, (a*x)/2 - (im*a*cos(c + d*x)^2)/(2*d) + (a*cos(c + d*x)*sin(c + d*x))/(2*d)]
    @test_int [cos(c + d*x)^4*(a + im*a*tan(c + d*x)), x, 4, (3*a*x)/8 - (im*a*cos(c + d*x)^4)/(4*d) + (3*a*cos(c + d*x)*sin(c + d*x))/(8*d) + (a*cos(c + d*x)^3*sin(c + d*x))/(4*d)]
    @test_int [cos(c + d*x)^6*(a + im*a*tan(c + d*x)), x, 5, (5*a*x)/16 - (im*a*cos(c + d*x)^6)/(6*d) + (5*a*cos(c + d*x)*sin(c + d*x))/(16*d) + (5*a*cos(c + d*x)^3*sin(c + d*x))/(24*d) + (a*cos(c + d*x)^5*sin(c + d*x))/(6*d)]
    @test_int [cos(c + d*x)^8*(a + im*a*tan(c + d*x)), x, 6, (35*a*x)/128 - (im*a*cos(c + d*x)^8)/(8*d) + (35*a*cos(c + d*x)*sin(c + d*x))/(128*d) + (35*a*cos(c + d*x)^3*sin(c + d*x))/(192*d) + (7*a*cos(c + d*x)^5*sin(c + d*x))/(48*d) + (a*cos(c + d*x)^7*sin(c + d*x))/(8*d)]

    @test_int [sec(c + d*x)^7*(a + im*a*tan(c + d*x)), x, 5, (5*a*atanh(sin(c + d*x)))/(16*d) + ((im/7)*a*sec(c + d*x)^7)/d + (5*a*sec(c + d*x)*tan(c + d*x))/(16*d) + (5*a*sec(c + d*x)^3*tan(c + d*x))/(24*d) + (a*sec(c + d*x)^5*tan(c + d*x))/(6*d)]
    @test_int [sec(c + d*x)^5*(a + im*a*tan(c + d*x)), x, 4, (3*a*atanh(sin(c + d*x)))/(8*d) + ((im/5)*a*sec(c + d*x)^5)/d + (3*a*sec(c + d*x)*tan(c + d*x))/(8*d) + (a*sec(c + d*x)^3*tan(c + d*x))/(4*d)]
    @test_int [sec(c + d*x)^3*(a + im*a*tan(c + d*x)), x, 3, (a*atanh(sin(c + d*x)))/(2*d) + ((im/3)*a*sec(c + d*x)^3)/d + (a*sec(c + d*x)*tan(c + d*x))/(2*d)]
    @test_int [sec(c + d*x)^1*(a + im*a*tan(c + d*x)), x, 2, (a*atanh(sin(c + d*x)))/d + (im*a*sec(c + d*x))/d]
    @test_int [cos(c + d*x)^1*(a + im*a*tan(c + d*x)), x, 2, -((im*a*cos(c + d*x))/d) + (a*sin(c + d*x))/d]
    @test_int [cos(c + d*x)^3*(a + im*a*tan(c + d*x)), x, 3, -((im*a*cos(c + d*x)^3)/(3*d)) + (a*sin(c + d*x))/d - (a*sin(c + d*x)^3)/(3*d)]
    @test_int [cos(c + d*x)^5*(a + im*a*tan(c + d*x)), x, 3, -((im*a*cos(c + d*x)^5)/(5*d)) + (a*sin(c + d*x))/d - (2*a*sin(c + d*x)^3)/(3*d) + (a*sin(c + d*x)^5)/(5*d)]
    @test_int [cos(c + d*x)^7*(a + im*a*tan(c + d*x)), x, 3, -((im*a*cos(c + d*x)^7)/(7*d)) + (a*sin(c + d*x))/d - (a*sin(c + d*x)^3)/d + (3*a*sin(c + d*x)^5)/(5*d) - (a*sin(c + d*x)^7)/(7*d)]


    @test_int [sec(c + d*x)^8*(a + im*a*tan(c + d*x))^2, x, 3, -((4*im*(a + im*a*tan(c + d*x))^6)/(3*a^4*d)) + (12*im*(a + im*a*tan(c + d*x))^7)/(7*a^5*d) - (3*im*(a + im*a*tan(c + d*x))^8)/(4*a^6*d) + (im*(a + im*a*tan(c + d*x))^9)/(9*a^7*d)]
    @test_int [sec(c + d*x)^6*(a + im*a*tan(c + d*x))^2, x, 3, -((4*im*(a + im*a*tan(c + d*x))^5)/(5*a^3*d)) + (2*im*(a + im*a*tan(c + d*x))^6)/(3*a^4*d) - (im*(a + im*a*tan(c + d*x))^7)/(7*a^5*d)]
    @test_int [sec(c + d*x)^4*(a + im*a*tan(c + d*x))^2, x, 3, -((im*(a + im*a*tan(c + d*x))^4)/(2*a^2*d)) + (im*(a + im*a*tan(c + d*x))^5)/(5*a^3*d)]
    @test_int [sec(c + d*x)^2*(a + im*a*tan(c + d*x))^2, x, 2, -((im*(a + im*a*tan(c + d*x))^3)/(3*a*d))]
    @test_int [sec(c + d*x)^0*(a + im*a*tan(c + d*x))^2, x, 2, 2*a^2*x - (2*im*a^2*log(cos(c + d*x)))/d - (a^2*tan(c + d*x))/d]
    @test_int [cos(c + d*x)^2*(a + im*a*tan(c + d*x))^2, x, 2, -((im*a^3)/(d*(a - im*a*tan(c + d*x))))]
    @test_int [cos(c + d*x)^4*(a + im*a*tan(c + d*x))^2, x, 4, (a^2*x)/4 - (im*a^4)/(4*d*(a - im*a*tan(c + d*x))^2) - (im*a^3)/(4*d*(a - im*a*tan(c + d*x)))]
    @test_int [cos(c + d*x)^6*(a + im*a*tan(c + d*x))^2, x, 4, (a^2*x)/4 - (im*a^5)/(12*d*(a - im*a*tan(c + d*x))^3) - (im*a^4)/(8*d*(a - im*a*tan(c + d*x))^2) - (3*im*a^3)/(16*d*(a - im*a*tan(c + d*x))) + (im*a^3)/(16*d*(a + im*a*tan(c + d*x)))]
    @test_int [cos(c + d*x)^8*(a + im*a*tan(c + d*x))^2, x, 4, (15*a^2*x)/64 - (im*a^6)/(32*d*(a - im*a*tan(c + d*x))^4) - (im*a^5)/(16*d*(a - im*a*tan(c + d*x))^3) - (3*im*a^4)/(32*d*(a - im*a*tan(c + d*x))^2) - (5*im*a^3)/(32*d*(a - im*a*tan(c + d*x))) + (im*a^4)/(64*d*(a + im*a*tan(c + d*x))^2) + (5*im*a^3)/(64*d*(a + im*a*tan(c + d*x)))]

    @test_int [sec(c + d*x)^5*(a + im*a*tan(c + d*x))^2, x, 5, (7*a^2*atanh(sin(c + d*x)))/(16*d) + (7*im*a^2*sec(c + d*x)^5)/(30*d) + (7*a^2*sec(c + d*x)*tan(c + d*x))/(16*d) + (7*a^2*sec(c + d*x)^3*tan(c + d*x))/(24*d) + (im*sec(c + d*x)^5*(a^2 + im*a^2*tan(c + d*x)))/(6*d)]
    @test_int [sec(c + d*x)^3*(a + im*a*tan(c + d*x))^2, x, 4, (5*a^2*atanh(sin(c + d*x)))/(8*d) + (5*im*a^2*sec(c + d*x)^3)/(12*d) + (5*a^2*sec(c + d*x)*tan(c + d*x))/(8*d) + (im*sec(c + d*x)^3*(a^2 + im*a^2*tan(c + d*x)))/(4*d)]
    @test_int [sec(c + d*x)^1*(a + im*a*tan(c + d*x))^2, x, 3, (3*a^2*atanh(sin(c + d*x)))/(2*d) + (3*im*a^2*sec(c + d*x))/(2*d) + (im*sec(c + d*x)*(a^2 + im*a^2*tan(c + d*x)))/(2*d)]
    @test_int [cos(c + d*x)^1*(a + im*a*tan(c + d*x))^2, x, 2, -((a^2*atanh(sin(c + d*x)))/d) - (2*im*cos(c + d*x)*(a^2 + im*a^2*tan(c + d*x)))/d]
    @test_int [cos(c + d*x)^3*(a + im*a*tan(c + d*x))^2, x, 2, (a^2*sin(c + d*x))/(3*d) - (2*im*cos(c + d*x)^3*(a^2 + im*a^2*tan(c + d*x)))/(3*d)]
    @test_int [cos(c + d*x)^5*(a + im*a*tan(c + d*x))^2, x, 3, (3*a^2*sin(c + d*x))/(5*d) - (a^2*sin(c + d*x)^3)/(5*d) - (2*im*cos(c + d*x)^5*(a^2 + im*a^2*tan(c + d*x)))/(5*d)]
    @test_int [cos(c + d*x)^7*(a + im*a*tan(c + d*x))^2, x, 3, (5*a^2*sin(c + d*x))/(7*d) - (10*a^2*sin(c + d*x)^3)/(21*d) + (a^2*sin(c + d*x)^5)/(7*d) - (2*im*cos(c + d*x)^7*(a^2 + im*a^2*tan(c + d*x)))/(7*d)]
    @test_int [cos(c + d*x)^9*(a + im*a*tan(c + d*x))^2, x, 3, (7*a^2*sin(c + d*x))/(9*d) - (7*a^2*sin(c + d*x)^3)/(9*d) + (7*a^2*sin(c + d*x)^5)/(15*d) - (a^2*sin(c + d*x)^7)/(9*d) - (2*im*cos(c + d*x)^9*(a^2 + im*a^2*tan(c + d*x)))/(9*d)]


    @test_int [sec(c + d*x)^8*(a + im*a*tan(c + d*x))^3, x, 3, -((8*im*(a + im*a*tan(c + d*x))^7)/(7*a^4*d)) + (3*im*(a + im*a*tan(c + d*x))^8)/(2*a^5*d) - (2*im*(a + im*a*tan(c + d*x))^9)/(3*a^6*d) + (im*(a + im*a*tan(c + d*x))^10)/(10*a^7*d)]
    @test_int [sec(c + d*x)^6*(a + im*a*tan(c + d*x))^3, x, 3, -((2*im*(a + im*a*tan(c + d*x))^6)/(3*a^3*d)) + (4*im*(a + im*a*tan(c + d*x))^7)/(7*a^4*d) - (im*(a + im*a*tan(c + d*x))^8)/(8*a^5*d)]
    @test_int [sec(c + d*x)^4*(a + im*a*tan(c + d*x))^3, x, 3, -((2*im*(a + im*a*tan(c + d*x))^5)/(5*a^2*d)) + (im*(a + im*a*tan(c + d*x))^6)/(6*a^3*d)]
    @test_int [sec(c + d*x)^2*(a + im*a*tan(c + d*x))^3, x, 2, -((im*(a + im*a*tan(c + d*x))^4)/(4*a*d))]
    @test_int [sec(c + d*x)^0*(a + im*a*tan(c + d*x))^3, x, 3, 4*a^3*x - (4*im*a^3*log(cos(c + d*x)))/d - (2*a^3*tan(c + d*x))/d + (im*a*(a + im*a*tan(c + d*x))^2)/(2*d)]
    @test_int [cos(c + d*x)^2*(a + im*a*tan(c + d*x))^3, x, 3, (-a^3)*x + (im*a^3*log(cos(c + d*x)))/d - (2*im*a^4)/(d*(a - im*a*tan(c + d*x)))]
    @test_int [cos(c + d*x)^4*(a + im*a*tan(c + d*x))^3, x, 2, -((im*a^5)/(2*d*(a - im*a*tan(c + d*x))^2))]
    @test_int [cos(c + d*x)^6*(a + im*a*tan(c + d*x))^3, x, 4, (a^3*x)/8 - (im*a^6)/(6*d*(a - im*a*tan(c + d*x))^3) - (im*a^5)/(8*d*(a - im*a*tan(c + d*x))^2) - (im*a^4)/(8*d*(a - im*a*tan(c + d*x)))]
    @test_int [cos(c + d*x)^8*(a + im*a*tan(c + d*x))^3, x, 4, (5*a^3*x)/32 - (im*a^7)/(16*d*(a - im*a*tan(c + d*x))^4) - (im*a^6)/(12*d*(a - im*a*tan(c + d*x))^3) - (3*im*a^5)/(32*d*(a - im*a*tan(c + d*x))^2) - (im*a^4)/(8*d*(a - im*a*tan(c + d*x))) + (im*a^4)/(32*d*(a + im*a*tan(c + d*x)))]

    @test_int [sec(c + d*x)^3*(a + im*a*tan(c + d*x))^3, x, 5, (7*a^3*atanh(sin(c + d*x)))/(8*d) + (7*im*a^3*sec(c + d*x)^3)/(12*d) + (7*a^3*sec(c + d*x)*tan(c + d*x))/(8*d) + (im*a*sec(c + d*x)^3*(a + im*a*tan(c + d*x))^2)/(5*d) + (7*im*sec(c + d*x)^3*(a^3 + im*a^3*tan(c + d*x)))/(20*d)]
    @test_int [sec(c + d*x)^1*(a + im*a*tan(c + d*x))^3, x, 4, (5*a^3*atanh(sin(c + d*x)))/(2*d) + (5*im*a^3*sec(c + d*x))/(2*d) + (im*a*sec(c + d*x)*(a + im*a*tan(c + d*x))^2)/(3*d) + (5*im*sec(c + d*x)*(a^3 + im*a^3*tan(c + d*x)))/(6*d)]
    @test_int [cos(c + d*x)^1*(a + im*a*tan(c + d*x))^3, x, 3, -((3*a^3*atanh(sin(c + d*x)))/d) - (3*im*a^3*sec(c + d*x))/d - (2*im*a*cos(c + d*x)*(a + im*a*tan(c + d*x))^2)/d]
    @test_int [cos(c + d*x)^3*(a + im*a*tan(c + d*x))^3, x, 1, ((-im/3)*cos(c + d*x)^3*(a + im*a*tan(c + d*x))^3)/d]
    @test_int [cos(c + d*x)^5*(a + im*a*tan(c + d*x))^3, x, 4, -((im*a^3*cos(c + d*x)^3)/(15*d)) + (a^3*sin(c + d*x))/(5*d) - (a^3*sin(c + d*x)^3)/(15*d) - (2*im*a*cos(c + d*x)^5*(a + im*a*tan(c + d*x))^2)/(5*d)]
    @test_int [cos(c + d*x)^7*(a + im*a*tan(c + d*x))^3, x, 4, -((3*im*a^3*cos(c + d*x)^5)/(35*d)) + (3*a^3*sin(c + d*x))/(7*d) - (2*a^3*sin(c + d*x)^3)/(7*d) + (3*a^3*sin(c + d*x)^5)/(35*d) - (2*im*a*cos(c + d*x)^7*(a + im*a*tan(c + d*x))^2)/(7*d)]
    @test_int [cos(c + d*x)^9*(a + im*a*tan(c + d*x))^3, x, 4, -((5*im*a^3*cos(c + d*x)^7)/(63*d)) + (5*a^3*sin(c + d*x))/(9*d) - (5*a^3*sin(c + d*x)^3)/(9*d) + (a^3*sin(c + d*x)^5)/(3*d) - (5*a^3*sin(c + d*x)^7)/(63*d) - (2*im*a*cos(c + d*x)^9*(a + im*a*tan(c + d*x))^2)/(9*d)]


    @test_int [sec(c + d*x)^3*(a + im*a*tan(c + d*x))^4, x, 6, (21*a^4*atanh(sin(c + d*x)))/(16*d) + (7*im*a^4*sec(c + d*x)^3)/(8*d) + (21*a^4*sec(c + d*x)*tan(c + d*x))/(16*d) + (im*a*sec(c + d*x)^3*(a + im*a*tan(c + d*x))^3)/(6*d) + (3*im*sec(c + d*x)^3*(a^2 + im*a^2*tan(c + d*x))^2)/(10*d) + (21*im*sec(c + d*x)^3*(a^4 + im*a^4*tan(c + d*x)))/(40*d)]
    @test_int [sec(c + d*x)^1*(a + im*a*tan(c + d*x))^4, x, 5, (35*a^4*atanh(sin(c + d*x)))/(8*d) + (35*im*a^4*sec(c + d*x))/(8*d) + (im*a*sec(c + d*x)*(a + im*a*tan(c + d*x))^3)/(4*d) + (7*im*sec(c + d*x)*(a^2 + im*a^2*tan(c + d*x))^2)/(12*d) + (35*im*sec(c + d*x)*(a^4 + im*a^4*tan(c + d*x)))/(24*d)]
    @test_int [cos(c + d*x)^1*(a + im*a*tan(c + d*x))^4, x, 4, -((15*a^4*atanh(sin(c + d*x)))/(2*d)) - (15*im*a^4*sec(c + d*x))/(2*d) - (2*im*a*cos(c + d*x)*(a + im*a*tan(c + d*x))^3)/d - (5*im*sec(c + d*x)*(a^4 + im*a^4*tan(c + d*x)))/(2*d)]
    @test_int [cos(c + d*x)^3*(a + im*a*tan(c + d*x))^4, x, 3, (a^4*atanh(sin(c + d*x)))/d - (2*im*a*cos(c + d*x)^3*(a + im*a*tan(c + d*x))^3)/(3*d) + (2*im*cos(c + d*x)*(a^4 + im*a^4*tan(c + d*x)))/d]
    @test_int [cos(c + d*x)^5*(a + im*a*tan(c + d*x))^4, x, 2, -((im*a*cos(c + d*x)^3*(a + im*a*tan(c + d*x))^3)/(15*d)) - (im*cos(c + d*x)^5*(a + im*a*tan(c + d*x))^4)/(5*d)]
    @test_int [cos(c + d*x)^7*(a + im*a*tan(c + d*x))^4, x, 4, (3*a^4*sin(c + d*x))/(35*d) - (a^4*sin(c + d*x)^3)/(35*d) - (2*im*a*cos(c + d*x)^7*(a + im*a*tan(c + d*x))^3)/(7*d) - (2*im*cos(c + d*x)^5*(a^4 + im*a^4*tan(c + d*x)))/(35*d)]
    @test_int [cos(c + d*x)^9*(a + im*a*tan(c + d*x))^4, x, 4, (5*a^4*sin(c + d*x))/(21*d) - (10*a^4*sin(c + d*x)^3)/(63*d) + (a^4*sin(c + d*x)^5)/(21*d) - (2*im*a*cos(c + d*x)^9*(a + im*a*tan(c + d*x))^3)/(9*d) - (2*im*cos(c + d*x)^7*(a^4 + im*a^4*tan(c + d*x)))/(21*d)]


    @test_int [sec(c + d*x)^8*(a + im*a*tan(c + d*x))^5, x, 3, -((8*im*(a + im*a*tan(c + d*x))^9)/(9*a^4*d)) + (6*im*(a + im*a*tan(c + d*x))^10)/(5*a^5*d) - (6*im*(a + im*a*tan(c + d*x))^11)/(11*a^6*d) + (im*(a + im*a*tan(c + d*x))^12)/(12*a^7*d)]
    @test_int [sec(c + d*x)^6*(a + im*a*tan(c + d*x))^5, x, 3, -((im*(a + im*a*tan(c + d*x))^8)/(2*a^3*d)) + (4*im*(a + im*a*tan(c + d*x))^9)/(9*a^4*d) - (im*(a + im*a*tan(c + d*x))^10)/(10*a^5*d)]
    @test_int [sec(c + d*x)^4*(a + im*a*tan(c + d*x))^5, x, 3, -((2*im*(a + im*a*tan(c + d*x))^7)/(7*a^2*d)) + (im*(a + im*a*tan(c + d*x))^8)/(8*a^3*d)]
